CREATE TABLE lab_protocols (
  protocol_id INT PRIMARY KEY,
  protocol_name VARCHAR(255) NOT NULL,
  procedure_description TEXT
);

CREATE TABLE lab_protocols (
  protocol_id INT PRIMARY KEY,
  protocol_name VARCHAR(255) NOT NULL,
  created_date DATE
);

CREATE TABLE lab_procedures (
  procedure_id INT PRIMARY KEY,
  procedure_name VARCHAR(255) NOT NULL,
  protocol_id INT REFERENCES lab_protocols(protocol_id)
);

CREATE TABLE lab_results (
  result_id INT PRIMARY KEY,
  result_value FLOAT NOT NULL,
  procedure_id INT REFERENCES lab_procedures(procedure_id)
);

